import Datt from "./Datt";
import '../Logs/Logitem.css';
import Card from "../UI/Card";

const Logtem =(props)=>{


    return (
        <Card className="item">
        <Datt/>
        <div className="content">
        <h2 className="desc">中文-letter</h2>
        <div className='time'>30分钟</div>
    </div>
    </Card>

    );
    };


export default Logitem;
